$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_74ab351eaad7c144ca073f3eff2b7513'] = 'Stav produktu (new, used, refurbished). Můžete použít ve feedu i vlastní hodnoty: doplňte je za dvojtečku, hodnoty oddělujte čárkou a zadávejte v pořadí pro \"nový\", \"výprodej\" a \"repasovaný produkt\", např.:';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_cd1803581af8ed1e0857a635845a6f62'] = 'Cena s DPH jako desetinné číslo (např. \"25.50\")';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_2b2a7f2ee73680e7076d3fa9c20148bf'] = 'Cena s DPH jako desetinné číslo, včetně zkratky měny (např. \"25.50 Kč\")';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_e890d5aca32cdcaf88caf2fb328cb38c'] = 'Cena s DPH jako desetinné číslo, včetně zkratky měny podle ISO-4217 (např. \"25.50 CZK\")';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_b9ea5cf09d46492f805f1dfdc8157674'] = 'Cena bez DPH jako desetinné číslo.';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_fb5ba65c8c54db5ebaf0ad957fa3e62d'] = 'Velkoobchodní cena bez DPH jako desetinné číslo.';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_e84b5a993fbd1748a37d12e1ddba7570'] = 'Proměnné %1$ s se zobrazují s desetinnou tečkou. Pokud chcete použít jiný oddělovač, například čárku, napište ji jako parametr: %2$s';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_874994521acb1312e760e1586d5144b6'] = 'Sazba DPH jako desetinné číslo.';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_9bc9c69757df7b49715da0a7e2c0ec63'] = 'Produkt je dostupný jen v e-shopu (= 1) nebo i v kamenné prodejně (= 0).';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_e1d9db1655eabc8b52788d9ced34339a'] = 'Datum a čas aktualizace produktu (GMT). Výchozí formát je Atom 1.0 (např. \"2012-12-08T14: 29:57+00:00\"), ale můžete zadat i svůj vlastní formát (viz funkce PHP date()). Příklad vlastního formátu:';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_d5b3e52ad44d6effb74a449d0014205d'] = 'Datum a čas vytvoření souboru (GMT). Můžete použít vlastní formát.';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_7e4bdb8c14e2ddf6c5925c9c50708e66'] = 'Místní datum a čas vytvoření feedu nebo poslední aktualizace produktu. Můžete použít vlastní formát.';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_fd9729117401f2408a403a8ebe07025d'] = 'Datum a čas vytvoření feedu.';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_161b8cb87c129d2b934e0c7ac64bd16b'] = 'Datum a čas přidání produktu do e-shopu..';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_764352d2d16125d31c0f256ba6855d4a'] = 'Datum a čas aktualizace produktu v e-shopu.';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_dbb630b0c07e98004b7075a6d7edcd84'] = 'Všechny proměnné s datem a časem používají jako výchozí formát  Atom 1.0 (např. \"2012-12-08T14:29:57+00:00\"). Je možné použít vlastní formát – viz funkce PHP date(). Jsou k dispozici dva modifikátory – LOCAL (výchozí nastavení) pro místní čas a GMT pro Greenwichský čas. Příklady:';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_72ebe7adff8cd643742c1788f1b2a2b7'] = 'Kód jazyka, v němž je tento feed (např. \"en-us\" pro americkou angličtinu).';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_3b754cdee0c6513e0090a0bad9d9db9b'] = 'Dvoupísmenový kód jazyka podle ISO 639-1 (např. \"en\" pro angličtinu).';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_8e8e6e248d40d788f7e9af05956216bc'] = 'Poznámka ke speciálním znakům';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_ec7d5a909f9fc8ee7a4189405f751691'] = 'Ze všech exportovaných dat se automaticky odstraňují HTML značky a speciální znaky (např. ostré závorky nebo &) se převádějí na HTML entity.';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_00424c7c0b567578b8c8e493998af600'] = 'Neplatí to v případě použití modifikátorů – viz níže.';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_ab38583cb2c8b20fce79578435547208'] = 'Modifikátory';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_ac3edd2ad95d8975c582651e54bca940'] = 'Určuje, že z proměnné se nebudou odstraňovat HTML značky. Převod speciálních znaků na entity ale stále platí. Nedoporučujeme používat u proměnnou description_short zároveň s oříznutím na zadaný počet znaků.';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_878252739e15f68a519793fbf046c387'] = 'Proměnná se obalí blokem CDATA, speciální znaky není potřeba převádět na entity. Lze použít pouze uvnitř prvku XML – uvnitř hodnoty atributu XML bude ignorováno.';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_7bc25abef39480bf52a70f966f61fbbf'] = 'Modifikátory ovlivňují pouze proměnnou, u které jsou použité. Zapisují se za jejím názvem, oddělené dvojtečkou a neuzavírají se do uvozovek. Pokud je u proměnné nějaký parametr, zapíšou se až za něj. Je možné použít i více modifikátorů, které musí být oddělené čárkou.';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_fd05d7f6bfc90e815087880e8e915b43'] = 'Příklady:';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_14b53c2844557ebd5f674dd05f008785'] = 'Krátký popis produktu včetně HTML značek.';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_e24bae8837b643c98f0f7bb1e92a9606'] = 'Krátký popis produktu oříznutý na 60 znaků, bez HTML značek a zabalený do bloku CDATA.';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_10db4a6778fab548ef1139ff9c16d560'] = 'Dlouhý popis produktu včetně HTML značek, zabalený do bloku CDATA.';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_808aaaa33716529eb7c9f658ff4a15b5'] = 'Dostupnost produktů';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_b9ed984d1bc0993b88059fba59b4079c'] = 'K dispozici jsou dvě různé proměnné, které indikují dostupnost produktu: \"days\" a \"availability\". Obě se řídí dostupnosti produktu (např. jestli je produkt je k dispozici na objednávku), viz \"dostupné pro objednávky\" v záložce Informace (Katalog > Produkty). Pokud je text zadaný u produktu, pak se zobrazí ve vašem obchodě (front office), v závislosti na tom, zda výrobek je k dispozici / není k dispozici / je k dispozici na objednávku (viz záložka Množství). Mohou být použity hodnoty tohoto textu. Proměnná \"days\" je jednodušší, zobrazí se první číslo nalezeno v textu. Proměnná \"availability\" je schopen rozlišovat mezi čísly (počet dní potřebných pro doručení) a data (např. když bude produkt k dispozici). Pro dostupnost produktu (\"availability\")  můžete nastavit i různé vlastní hodnoty (např. skladem / na zakázku / vyprodáno).';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_6bc09b7ab2f348ddbbac519344d5f64f'] = 'Pokud je produkt na skladě, je bude vloženo do feedu první číslo z textu (ve vašem obchodě) pro produkt skladem nebo pokud není k dispozici. Pokud produkt není skladem a hodnota pro \"availability\" je prázdná, pak nebude vrácena žádná hodnota. Pak záleží na nastavení konkrétního feedu, jestli tag XML může být prázdný nebo ne.';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_f6073a955c77cf3c8376d37aa8ccb496'] = 'Tato proměnná umožňuje, podobně jako {condition}, zadat různé vlastní hodnoty. Výchozí funkčnost je tato: u produktů, které jsou skladem, vloží stejné číslo jako {days}. Totéž u produktů, které nejsou skladem, ale je možné je objednat. Nedostupné produkty se do feedu vůbec nevloží.';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_5e95660d8f89d53e778c2be9e7dc0c78'] = 'Možnosti přizpůsobení: vlastní hodnoty se zadávají v pořadí \"skladem\", \"na objednávku\" a \"vyprodané\". Neměly by ale začínat mřížkou, ta je vyhrazena pro speciální hodnoty. Za čárkami můžete pro lepší čitelnost nechávat mezery.';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_2b20fa9063a1bcc45ce151b954d22063'] = 'Tato proměnná obsahuje popis dostupnosti produktů přesně tak, jak bylo zadáno v administraci (BO) pro tento produkt.';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_8d5373cfcd25d53d49529403e0f5b94f'] = 'U produktů, které jsou na skladě, se do feedu vloží \"in stock\". Další dvě hodnoty jsou pro zboží, které není skladem. Pokud je povolené objednávání zboží, které není skladem, použije se druhá hodnota (\"on order\"). Pokud není povolené ho objednávat, a zároveň je zadaná třetí hodnota, použije se třetí hodnota (\"sold out\"). Pokud není povolené objednávat produkt a třetí hodnota chybí, položka se vůbec neexportuje.';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_e5703e83489d1b3b1aebcc75f28d271a'] = 'V Pro verzi modulu se rozlišuje dostupnost celého produktu a kombinace atributů.';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_2c4261d887578ef5095a1e4817beaa4f'] = 'Vloží se zadané texty, do feedu se přidají i nedostupné produkty.';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_608310cd01dadb86e4f25b460d27c0a0'] = 'U produktů skladem se vloží číslo. U produktů na objednávku buď číslo, anebo datum zformátované podle zadání (viz PHP funkce date). Výchozí chování pro nedostupné produkty se nebude měnit, takže jej lze vynechat.';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_0642848367ccb9190d7d9de721991265'] = 'Pokud chcete u produktů skladem ještě rozlišovat podle dodací lhůty, zadejte počet dní, hodnotu pokud je dostupnost menší nebo rovna počtu dní a hodnotu pro pozdější dostupnost, oddělujte dvojtečkou. Podle tohoto příkladu se u produktů skladem, které budou odeslány do tří dnů vloží hodnota \"immediately\" (ihned), u ostatních produktů skladem se vloží \"expected product\" (očekávany produkt). U produktů na objednávku se vloží číslo/datum.';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_e5472aea187bb18cb4ef76fe839b34db'] = 'U produktů se stavem \"in stock\", je zadán počet výrobků. Produkty se stavem \"on the way\", se vloží číslo nebo datum. Nedostupné produkty nejsou vůbec přidány do feedu (to je výchozí nastavení).';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_d2485422084f95b260b683798d114bc8'] = 'Nastavení pro Nákupy Google (Google Merchant Center): U produktů, které budou odeslány do tří dnů včetně, se vloží \"in stock\", u ostatních produktů skladem \"available for order\". U produktů, které nejsou skladem, ale jsou povoleny objednávky, se vloží \"preorder\". U nedostupných produktů se vloží \"out of stock\".';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_00430662ac232b819d9c5269a624b055'] = 'Atributy a kombinace';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_1ed21320c9fc01bff3fc0b52cc0b9a73'] = 'Varianty produktu:';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_8ac32c0f4005a83febab8c7208778727'] = 'XML element, který se opakuje pro každou variantu výrobku (tj. na kombinaci atributů), měl by být označen atributem XML \"ps_block\" s hodnotou \"variant\"  (např. %1$s). Pokud je každá varianta exportována jako nový produkt (např. pro  Google Merchant), použijte dvě hodnoty oddělené mezerou (např. %2$s). Následující proměnné jsou k dispozici uvnitř variant produktu:';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_2a9b24bf17e7ee36d0b1bfcb59336294'] = 'Jedinečný identifikátor této varianty produktu';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_98e94524cb5ce696e9d36135600b5c13'] = 'Souhrn atributů této varianty (např. u oblečení zde bude \"dámské červené XL\")';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_1caa6ff629641a4eb20f190f7a0539ca'] = 'Název atributu';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_8d1c197eb15df88813cc8115734109ea'] = 'Pomocí této proměnné lze exportovat samostatně jednotlivé atributy varianty jako velikost, barvu apod. Název atributu zadejte stejně, jak je uvedený v administraci atributů a kombinací, a ve stejném jazyce, který je nastaven pro tento feed. Např. u českého feedu použijete {attrib: \"barva\"} a {attrib: \"velikost\"}, ale u anglického {attrib: \"color\"} a {attrib: \"size\"}. Název zadávejte vždy malými písmeny.';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_164fd816ec3ab0eb5c1550306da1f97a'] = 'Pro některé vlastnosti produktů (např. EAN13) můžete v administraci nastavit odlišné hodnoty pro každou variantu. Například: u výchozí varianty produktu je nastavený kód EAN13, u druhé varianty je nastavený jiný EAN13, u třetí varianty není EAN13 vyplněný. Proměnnou %1$s použijeme na dvou místech, v kontextu produktu a v kontextu varianty:';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_5aac38deec604d81565722cc5a2a6be1'] = 'Výsledek:';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_97f08a40f22a625d0cbfe03db3349108'] = 'ID produktu';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_42b64754f98eebba34d14f596fce9c67'] = 'EAN13 produktu';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_c4ca5d74c7a25a29b39dc8e3a146535b'] = 'ID výchozí varianty produktu';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_3adad6e807760fe6e681f0077e2f4ae5'] = 'EAN13 výchozí varianty produktu';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_84eb37e5b5a383bcbaa31c7666f5b203'] = 'ID druhé varianty produktu';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_6da1e88ff7089c53760e3217ffbd11c1'] = 'Odlišný EAN13 druhé varianty produktu';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_293516d206088c71ab3a89603a9c9413'] = 'ID třetí varianty produktu';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_d087d8a3e4141263dd723789a0358a1e'] = 'EAN13 produktu';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_134c3ad95ad7a97d47b4f43f62e8b951'] = 'EAN13 třetí varianty produktu nebyl vyplněný, takže se místo něj použil EAN13, který je nastavený u základní verze produktu. Stejným způsobem se exportují data i do všech ostatních proměnných, které se mohou u každé varianty lišit:';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_24105f23ff08f72c9aefc13a1c6676af'] = 'Jednotlivé atributy:';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_bb51ce3d1ecb2ff2438522e2f7274284'] = 'Některé srovnávače cen (např. Heureka nebo Pricemania.sk) vyžadují zadávat jednotlivé varianty atributů samostatně jako páry název + hodnota. Tady použijte XML atribut \"ps_block\" s hodnotou \"attribute\". K dispozici jsou další dvě proměnné:';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_1cf8701415bd6858914ef6798b40ac59'] = 'Hodnota atributu';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_9f4cf0275df9038492fb608221e5e1fe'] = 'Příklad: Oblečení má dva atributy: barvu a velikost. Ve feedu pro Heureka.cz/sk zadejte:';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_12d1f4ecf9492c3a747a58fa277c4243'] = 'Ke každé variantě produktu se bude exportovat:';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_f7bd60b75b29d79b660a2859395c1a24'] = 'velikost';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_70dda5dfb8053dc6d1c492574bce9bfd'] = 'barva';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_9f27410725ab8cc8854a2769c7a516b8'] = 'zelená';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_4829243e90f6a3a5afd96555a82edd26'] = 'Vlastnosti produktu';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_cea9aa9551991a160c1ea5c6afaebfd7'] = 'Pomocí této proměnné můžete exportovat jednotlivé vlastnosti produktu, jako je hmotnost, materiál, země původu atd. Tato proměnná akceptuje tři parametry: text zobrazený před názvem vlastnosti, text mezi názvem vlastností a její hodnotou a text po hodnotě vlastnosti.';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_faf4cfe3000430c0427c0f9337cca572'] = 'Příklad: boty mají dvě vlastnosti: materiál svršku a podešve. Do šablony feedu zadejte následující kód:';
$_MODULE['<{prestacenterxmlexportpro}prestashop>feedlegend_9dce1eb2c3d9417389bef2333ed2b305'] = 'Vyexportuje se toto:';
